  ssr: false
})

const DemoWrapper = styled.div`
  width: 100vw;
  heght: 100%;
  overflow: hidden;
`;

const IFrameWrapper = styled.div`
  width: 100vw;
  height: 100%;
  min-height: 100vh;

`;

const XOHDemo = ({}) => (
  <DemoWrapper>
    <SommWidget />

  </DemoWrapper>
);

export default XOHDemo;
